import{_ as p}from"./_plugin-vue_export-helper.cdc0426e.js";import{o,c as t,f as n}from"./app.2ed33847.js";const r={},s=n('<h1 id="\u5175\u53D8\u4E0E\u5185\u5377" tabindex="-1"><a class="header-anchor" href="#\u5175\u53D8\u4E0E\u5185\u5377" aria-hidden="true">#</a> \u5175\u53D8\u4E0E\u5185\u5377</h1><p>\u516D\u9547\u4E4B\u4E71\u5728<strong>\u5317\u9B4F</strong>\u7684\u5386\u53F2\u4E2D\u6709\u7740\u91CD\u8981\u610F\u4E49\uFF0C\u5982\u679C\u975E\u8981\u7ED9\u8FD9\u4E2A\u5E1D\u56FD\u7684\u7531\u76DB\u8F6C\u8870\u627E\u5230\u4E00\u4E2A\u4E34\u754C\u70B9\uFF0C\u90A3\u4E48\u5B83\u65E0\u7591\u662F\u6700\u51C6\u786E\u7684\u90A3\u5EA7\u754C\u7891\u3002</p><p>\u672C\u7BC7\uFF0C\u6211\u4EEC\u5C31\u6765\u4ECB\u7ECD\u516D\u9547\u4E4B\u4E71\u7684\u4E00\u4E9B\u524D\u56E0\u540E\u679C\uFF0C\u4EE5\u53CA\uFF0C\u901A\u8FC7\u5BF9\u516D\u9547\u4E4B\u4E71\u7684\u68B3\u7406\uFF0C\u8C08\u4E00\u8C08\u5728\u4E0B\u81EA\u5DF1\u5BF9\u4E8E\u5F53\u4E0B\u5927\u70ED\u7684\u201C<strong>\u5185\u5377</strong>\u201D\uFF0C\u662F\u600E\u4E48\u7406\u89E3\u7684\u3002</p><blockquote><p>\u9996\u5148\u6765\u4ECB\u7ECD\u4E00\u4E0B\u4EC0\u4E48\u662F\u201C\u516D\u9547\u201D\uFF1A</p></blockquote><p>\u6240\u8C13\u516D\u9547\uFF0C\u662F\u6307\u5317\u9B4F\u8BBE\u7F6E\u5728\u8FB9\u754C\u7684\u6C83\u91CE\u3001\u6000\u6714\u3001\u6B66\u5DDD\u3001\u629A\u51A5\u3001\u67D4\u7384\u3001\u6000\u8352\u7B49\u516D\u4E2A\u519B\u9547\u3002</p><p>\u8FD9\u516D\u4E2A\u519B\u9547\u7684\u4E3B\u8981\u4F5C\u7528\uFF0C\u5C31\u662F\u653B\u51FB\u67D4\u7136\uFF0C\u9632\u5907\u9996\u90FD\u2014\u2014\u5F53\u65F6\uFF0C\u5317\u9B4F\u7684\u9996\u90FD\u8FD8\u6CA1\u8FC1\u5230\u6D1B\u9633\uFF0C\u800C\u662F\u5728\u5317\u65B9\u7684\u5E73\u57CE\uFF08\u4ECA\u5C71\u897F\u5927\u540C\uFF09\u3002</p><p>\u4F60\u53EF\u4EE5\u7406\u89E3\u4E3A\uFF0C<strong>\u516D\u9547\u5F53\u65F6\u6240\u9A7B\u519B\u961F\uFF0C\u5C31\u662F\u56FD\u5BB6\u7684\u4E2D\u592E\u5E38\u5907\u519B</strong>\u2014\u2014\u4E3B\u8981\u4F5C\u7528\uFF0C\u5C31\u662F<strong>\u9632\u5907\u67D4\u7136</strong>\u3002</p><p>\u5728\u5317\u9B4F\u65E9\u671F\u7684\u5386\u53F2\u4E2D\uFF0C\u7687\u5E1D\u90FD\u6709\u4EB2\u81EA\u9886\u5175\u51FA\u5F81\u7684\u4E60\u60EF\uFF0C\u6240\u4EE5\u516D\u9547\u519B\u961F\u662F\u6700\u5BB9\u6613\u63A5\u89E6\u5230\u7687\u5E1D\uFF0C\u4E5F\u6700\u5BB9\u6613\u5EFA\u7ACB\u519B\u529F\u7684\u5730\u65B9\u3002<strong>\u56E0\u6B64\uFF0C\u5927\u91CF\u7684\u9C9C\u5351\u8D35\u65CF\u5B50\u5F1F\u8FDB\u5165\u5230\u4E86\u519B\u4E2D\uFF0C\u4EE5\u6C42\u664B\u8EAB\u4E4B\u9636</strong>\u3002</p><p>\u6B64\u5916\uFF0C\u8FD8\u6709\u53E6\u5916\u4E00\u4E9B\u4EBA\u4E5F\u8FDB\u5165\u5230\u4E86\u516D\u9547\u519B\u4E2D\uFF0C\u6BD4\u5982\uFF0C<strong>\u6B7B\u56DA</strong>\u3002</p><p>\u4E3A\u4EC0\u4E48\u8FD9\u4E9B\u4EBA\u4E5F\u80FD\u6DF7\u5165\u5176\u4E2D\u5462\uFF1F</p><p><strong>\u9996\u5148\uFF0C\u662F\u80FD\u201C\u5E9F\u7269\u5229\u7528\u201D</strong>\u3002\u6BD5\u7ADF\u662F\u4E00\u6761\u6C49\u5B50\uFF0C\u5C31\u7B97\u4E0D\u80FD\u6253\u4ED7\uFF0C\u505A\u4E2A\u82E6\u529B\u4E5F\u662F\u6709\u4EF7\u503C\u7684\u3002</p><p><strong>\u5176\u6B21\uFF0C\u5728\u4E8E\u6709\u5F52\u5C5E\u611F</strong>\u3002\u6B7B\u56DA\u4E00\u65E6\u8FDB\u5165\u5317\u9547\uFF0C\u5C31\u662F\u5F00\u59CB\u4E86\u4E00\u6BB5\u65B0\u7684\u4EBA\u751F\u3002\u8FD9\u5BF9\u4E8E\u5F88\u591A\u4EBA\uFF0C\u5C24\u5176\u662F\u5BF9\u90A3\u4E9B\u51F6\u72E0\u597D\u6597\u5145\u6EE1\u6545\u4E8B\u7684\u4EBA\u6765\u8BF4\uFF0C\u7B80\u76F4\u5C31\u662F\u7ED9\u4ED6\u4EEC\u63D0\u4F9B\u4E86\u4E00\u7247\u53EF\u4EE5\u5927\u653E\u5F02\u5F69\u7684\u5E7F\u9614\u5929\u5730\u3002</p><p>\u90A3\u4E3A\u4EC0\u4E48\u53C8\u4F1A\u8BF4\u5230\u5F52\u5C5E\u611F\u5462\uFF1F\u8FD9\u4E3B\u8981\u662F\u56E0\u4E3A\uFF0C<strong>\u4ED6\u4EEC\u7684\u5211\u7F5A\u8C41\u514D\u6743\u53EA\u5728\u516D\u9547\u624D\u6709\u7528</strong>\u3002\u4E00\u65E6\u79BB\u5F00\u4E86\u201C\u516D\u9547\u201D\uFF0C\u5C31\u4EC0\u4E48\u90FD\u4E0D\u662F\u4E86\u3002</p><p>\u5982\u679C\u4F60\u770B\u8FC7\u300A\u51B0\u4E0E\u706B\u4E4B\u6B4C\u300B\uFF0C\u6B64\u523B\u662F\u4E0D\u662F\u5DF2\u7ECF\u60F3\u8D77\u4E86\u5B88\u591C\u4EBA\u7684\u6C49\u5B50\uFF1F</p><p>\u8FD9\u79CD\u60C5\u5F62\uFF0C\u81EA\u5317\u9B4F\u5F00\u56FD\u4EE5\u6765\uFF0C\u4E00\u76F4\u6301\u7EED\u4E86\u7EA6\u4E00\u767E\u591A\u5E74\u3002</p><p><strong>\u76F4\u5230\u5B5D\u6587\u5E1D\u8FC1\u90FD</strong>\u3002</p><p>\u5176\u5B9E\u5728\u8FC1\u90FD\u4EE5\u524D\uFF0C\u5C31\u5DF2\u7ECF\u6709\u4E9B\u82D7\u5934\u4E86\uFF1A\u4E3A\u4EC0\u4E48\u8981\u8FC1\u90FD\uFF1F\u4E00\u4E2A\u5F88\u91CD\u8981\u7684\u524D\u63D0\u6761\u4EF6\uFF0C\u5C31\u662F\u67D4\u7136\u5728\u5317\u9B4F\u7684\u4E0D\u65AD\u6253\u51FB\u4E4B\u4E0B\u5DF2\u7ECF\u52BF\u5F31\uFF0C\u4E0D\u518D\u662F\u5317\u9B4F\u7684\u4E3B\u8981\u4F5C\u6218\u76EE\u6807\u3002</p><p>\u800C\u968F\u7740\u5B5D\u6587\u5E1D\u6B63\u5F0F\u9881\u5E03\u8FC1\u90FD\u7684\u8BCF\u4EE4\uFF0C<strong>\u8FD9\u652F\u4E2D\u592E\u519B\u7684\u5730\u4F4D\u4E00\u843D\u5343\u4E08\uFF0C\u4E00\u591C\u4E4B\u95F4\u5C31\u53D8\u6210\u4E86\u201C\u6742\u724C\u519B\u201D</strong>\u3002</p><p>\u4E86\u89E3\u6C11\u56FD\u53F2\u7684\u4EBA\u90FD\u77E5\u9053\u8FD9\u5F53\u4E2D\u7684\u5DEE\u8DDD\u80FD\u6709\u591A\u5927\uFF0C\u66F4\u4F55\u51B5\u8EAB\u5728\u5F53\u65F6\uFF0C\u4F60\u8FD8\u5904\u5904\u90FD\u80FD\u611F\u53D7\u5F97\u5230\u5BF9\u6BD4\uFF1A</p><p>\u672C\u6765\uFF0C\u8EAB\u5728\u516D\u9547\u7684\u9C9C\u5351\u8D35\u65CF\u4EEC\u4E5F\u662F\u8FD9\u4E2A\u56FD\u5BB6\u7684\u4E0A\u7B49\u4EBA\u3002\u4F46\u81EA\u8FC1\u90FD\u4EE5\u540E\uFF0C\u4ED6\u4EEC\u8FC1\u5165\u6CB3\u5357\u7684\u4EB2\u621A\u3001\u540C\u65CF\u90FD\u53D8\u6210\u4E86\u7FBD\u6797\u3001\u864E\u8D32\uFF0C\u4E0E\u52CB\u8D35\u58EB\u65CF\u540C\u5217\uFF1B\u800C\u4ED6\u4EEC\u8FD9\u4E9B\u5F53\u5E74\u7684\u201C\u56FD\u4E4B\u80BA\u8151\u201D\uFF0C\u5374\u7A81\u7136\u6CA6\u4E3A\u8EAB\u4EFD\u4F4E\u4E0B\u7684\u9547\u6237\u3002</p><p><strong>\u540C\u65F6\u5931\u53BB\u7684\uFF0C\u662F\u672A\u6765\u4E0E\u5E0C\u671B</strong>\u3002</p><p>\u7AD9\u5728\u671D\u5EF7\u7684\u89D2\u5EA6\u4E0A\uFF0C\u516D\u9547\u7684\u4F5C\u7528\u4F9D\u7136\u8FD8\u662F\u9632\u5907\u67D4\u7136\uFF0C\u4F46\u65E2\u7136\u5DF2\u7ECF\u4E0D\u662F\u4E2D\u592E\u519B\u4E86\uFF0C\u90A3\u5F85\u9047\u81EA\u7136\u5C31\u5F97\u76F8\u5E94\u4E0B\u964D\u3002\u53EF\u516D\u9547\u7684\u5B58\u5728\uFF0C\u672C\u5C31\u9700\u8981\u671D\u5EF7\u4E0D\u65AD\u7684\u63D0\u4F9B\u8D44\u6E90\u3002<strong>\u5982\u4ECA\u8D44\u6E90\u8D8A\u6765\u8D8A\u5C11\uFF0C\u4EBA\u5374\u8FD8\u662F\u90A3\u4E9B\u4EBA\u2014\u2014\u8FDB\u5165\u516D\u9547\u4EE5\u540E\uFF0C\u9547\u6C11\u4FBF\u88AB\u8F6C\u4E3A\u201C\u5E9C\u6237\u201D\uFF0C\u5C5E\u4E8E\u519B\u5E9C\uFF0C\u4E16\u88AD\u4E3A\u5175\uFF0C\u4E0D\u51C6\u8FC1\u79FB</strong>\u3002</p><p>\u8FD9\u5C31\u610F\u5473\u7740\uFF0C\u968F\u7740\u65F6\u95F4\u4E0D\u65AD\u63A8\u79FB\uFF0C<strong>\u8FD9\u79CD\u4F9B\u7ED9\u4E0E\u9700\u6C42\u4E4B\u95F4\u7684\u7F3A\u53E3\uFF0C\u4F1A\u53D8\u5F97\u8D8A\u6765\u8D8A\u5927</strong>\u3002</p><p>\u5230\u5B5D\u6587\u5E1D\u7684\u513F\u5B50\u2014\u2014<strong>\u5BA3\u6B66\u5E1D</strong>\u65F6\u671F\uFF0C\u5317\u9547\u66FE\u4E00\u5EA6\u5F15\u53D1\u8FC7\u671D\u5EF7\u7684\u5173\u6CE8\u3002</p><p>\u666F\u660E\u56DB\u5E74\uFF08\u516C\u5143503\u5E74\uFF09\uFF0C\u56E0\u4E3A\u8FB9\u9547\u767E\u59D3\u8D2B\u56F0\uFF0C\u5BA3\u6B66\u5E1D\u547D\u5C1A\u4E66\u5DE6\u4EC6\u5C04<strong>\u6E90\u6000</strong>\u5DE1\u89C6\u5317\u8FB9\u3002</p><p>\u53F2\u8F7D\uFF0C\u6E90\u6000\u7684\u4EFB\u52A1\u662F\u201C<strong>\u8D48\u7ED9\u8D2B\u4E4F\uFF0C\u8003\u8BBA\u6BBF\u6700\uFF0C\u4E8B\u4E4B\u5F97\u5931\u7686\u5148\u51B3\u540E\u95FB</strong>\u201D\u3002</p><p>\u800C\u6E90\u6000\u53BB\u4E86\u4EE5\u540E\uFF0C<strong>\u5904\u7406\u4E86\u4E00\u5927\u6279\u7684\u8D2A\u5B98\u6C61\u540F</strong>\u3002</p><blockquote><p>\u8FD9\u5176\u4E2D\uFF0C\u6709\u4E24\u6761\u7EC6\u8282\u4E0A\u7684\u8BB0\u8F7D\u5F88\u6709\u610F\u601D\uFF1A</p></blockquote><p><strong>\u7B2C\u4E00\u6761</strong>\uFF0C\u662F\u201C\u65F6\u7EC6\u6C11\u4E3A\u8C6A\u5F3A\u9675\u538B\uFF0C\u79EF\u5E74\u6789\u6EDE\uFF0C\u4E00\u671D\u89C1\u7533\u8005\uFF0C\u65E5\u6709\u767E\u6570\u3002\u201D</p><p>\u8001\u767E\u59D3\u88AB\u8C6A\u5F3A\u6240\u6B3A\u538B\uFF0C\u6848\u4EF6\u79EF\u5E74\u4E0D\u5BA1\u3002\u5982\u4ECA\u6E90\u6000\u524D\u6765\uFF0C\u5E2E\u52A9\u767E\u59D3\u4F38\u51A4\uFF0C\u6848\u5B50\u6BCF\u5929\u6709\u4E0A\u767E\u4EF6\u4E4B\u591A\u3002</p><p>\u8981\u6CE8\u610F\uFF0C\u8FD9\u662F\u53D1\u751F\u5728\u516D\u9547\u4E4B\u4E71\u4E8C\u5341\u591A\u5E74\u524D\u7684\u4E8B\uFF0C<strong>\u53EF\u89C1\u5F53\u65F6\u516D\u9547\u7684\u5185\u90E8\u77DB\u76FE\u5DF2\u7ECF\u4E25\u91CD\u5230\u4F55\u79CD\u7A0B\u5EA6</strong>\u3002</p><p><strong>\u7B2C\u4E8C\u6761</strong>\uFF0C\u662F\u6E90\u6000\u7684\u4E0A\u594F\u3002\u4ED6\u8BF4\uFF0C\u201C\u8FB9\u9547\u4E8B\u5C11\u800C\u7F6E\u5B98\u7325\u591A\uFF0C\u6C83\u91CE\u4E00\u9547\u81EA\u5C06\u4EE5\u4E0B\u516B\u767E\u9980\u4EBA\uFF1B\u8BF7\u4E00\u5207\u4E94\u5206\u635F\u4E8C\u3002\u201D</p><p>\u6E90\u6000\u8BA4\u4E3A\uFF0C\u8FB9\u9547\u4E8B\u5C11\u800C\u5B98\u591A\uFF0C<strong>\u6C83\u91CE\u9547\u81EA\u5C06\u4EE5\u4E0B\uFF0C\u6709\u5B98\u5458\u516B\u767E\u591A\u4EBA\uFF0C\u88C1\u6389\u4E94\u5206\u4E4B\u4E8C\u6B63\u597D</strong>\u3002</p><p>\u671D\u5EF7\u6279\u51C6\u4E86\u8FD9\u4E2A\u5EFA\u8BAE\u3002</p><p>\u8BDD\u672C\u91CC\u4E00\u5411\u5F88\u559C\u6B22\u8FD9\u79CD\u9752\u5929\u5927\u8001\u7237\u4E3A\u6C11\u505A\u4E3B\u7533\u51A4\u60C5\u7684\u6545\u4E8B\uFF0C\u4F46\u653E\u5728\u73B0\u5B9E\u4E2D\uFF0C\u6E90\u6000\u7684\u529E\u6CD5\u5374\u4E00\u70B9\u90FD\u89E3\u51B3\u4E0D\u4E86\u6839\u672C\u95EE\u9898\uFF1A</p><p><strong>\u53EA\u8981\u5317\u9547\u9547\u6C11\u65E0\u6CD5\u79BB\u5F00\u7684\u6B7B\u7ED3\u6253\u4E0D\u5F00\uFF0C\u77DB\u76FE\u5C31\u4F1A\u4E00\u76F4\u5B58\u5728\u4E0B\u53BB</strong>\u3002\u5982\u4ECA\u5B98\u591A\u662F\u4E0D\u5047\uFF0C\u4F46\u4E00\u4E0B\u5B50\u88C1\u6389\u4E94\u5206\u4E4B\u4E8C\uFF0C\u8FD9\u79CD\u505A\u6CD5\u5E76\u4E0D\u662F\u5728\u89E3\u51B3\u95EE\u9898\uFF0C\u800C\u662F\u5728\u52A0\u5267\u7ADE\u4E89\u77DB\u76FE\u3002</p><p>\u6E90\u6000\u81EA\u5DF1\u505A\u4E86\u4E00\u6B21\u9752\u5929\u5927\u8001\u7237\uFF0C\u4F46\u4ECE\u6839\u672C\u4E0A\u8BB2\uFF0C<strong>\u4ED6\u4E00\u6765\u6CA1\u6709\u89E3\u51B3\u516D\u9547\u7684\u95EE\u9898\uFF0C\u4E8C\u6765\u8FD8\u52A0\u5267\u4E86\u5317\u9547\u7684\u5185\u90E8\u77DB\u76FE</strong>\u3002</p><p>\u6B64\u540E\uFF0C\u516D\u9547\u53C8\u4E00\u6B21\u88AB\u671D\u5EF7\u6240\u9057\u5FD8\uFF0C\u76F4\u5230\u516D\u9547\u4E4B\u4E71\u7206\u53D1\u3002</p><p>\u6700\u540E\u70B9\u71C3\u70B8\u836F\u6876\u7684\u90A3\u4E00\u70B9\u706B\u82B1\uFF0C\u8FF8\u51FA\u5F97\u5F88\u610F\u5916\uFF0C\u4F46\u53C8\u5728\u60C5\u7406\u4E4B\u4E2D\uFF1A<strong>\u6000\u8352\u9547\u7684\u9547\u6C11\u56E0\u4E3A\u6028\u6068\u9547\u5C06\u4E0D\u53D1\u7CAE\u5EEA\uFF0C\u6740\u9547\u5C06\u800C\u53CD</strong>\u3002\u4E0D\u4E45\u540E\uFF0C\u6C83\u91CE\u9547\u7684\u9547\u6C11<strong>\u7834\u516D\u97E9\u62D4\u9675</strong>\uFF08\u8FD9\u662F\u4E2A\u4EBA\u540D\uFF09\u805A\u4F17\u6740\u9547\u5C06\uFF0C\u5360\u9886\u6C83\u91CE\u9547\u79F0\u738B\u3002</p><p>\u90A3\u5317\u9B4F\u671D\u5EF7\u53C8\u662F\u5982\u4F55\u5E94\u5BF9\u7684\u5462\uFF1F</p><p>\u5728\u6B64\u524D\u540E\uFF0C\u5317\u9B4F\u4E0A\u4E0B\u5DF2\u7ECF\u5B8C\u5168\u662F\u4E00\u526F\u672B\u4E16\u666F\u8C61\uFF1A\u671D\u5EF7\u91CC\uFF0C\u6587\u606C\u6B66\u5B09\uFF0C\u8150\u8D25\u4E0D\u582A\uFF1B\u5730\u65B9\u4E0A\uFF0C\u72FC\u70DF\u904D\u8D77\uFF0C\u5371\u6025\u56DB\u4F0F\u3002</p><p><strong>\u75B2\u4E8E\u5E94\u5BF9\u7684\u5B5D\u660E\u5E1D\u671D\u5EF7\uFF0C\u6B64\u65F6\u5DF2\u7ECF\u65E0\u5175\u529B\u53EF\u8C03</strong>\u3002\u8FD8\u5728\u5BA3\u6B66\u5E1D\u4E00\u671D\u65F6\uFF0C\u56E0\u4E3A\u4E0E\u5357\u65B9\u4F5C\u6218\u5927\u8D25\uFF0C\u5317\u9B4F\u5C31\u635F\u5931\u4E86\u4E8C\u5341\u4F59\u4E07\u5175\u529B\u3002\u5982\u4ECA\u53C8\u9022\u56FD\u5185\u53CD\u53DB\u4E0D\u65AD\uFF0C\u7126\u5934\u70C2\u989D\u7684\u671D\u5EF7\u54EA\u91CC\u8FD8\u62BD\u5F97\u51FA\u5175\u53BB\u5E73\u53DB\uFF1F</p><p>\u6700\u7EC8\uFF0C<strong>\u5317\u9B4F\u8FD8\u662F\u501F\u52A9\u67D4\u7136\u7684\u52BF\u529B\uFF0C\u624D\u527F\u706D\u4E86\u53DB\u4E71</strong>\u2014\u2014\u67D4\u7136\u5F53\u7136\u4E50\u5F97\u501F\u8FD9\u4E2A\u673A\u4F1A\u62D4\u6389\u8FD9\u4E9B\u5B58\u5728\u4E86\u4E00\u767E\u591A\u5E74\u7684\u773C\u4E2D\u9489\u3002</p><p>\u540C\u65F6\uFF0C\u53E6\u4E00\u4E2A\u91CD\u8981\u539F\u56E0\u662F\uFF0C<strong>\u6240\u8C13\u7684\u516D\u9547\u4E4B\u4E71\uFF0C\u5176\u5B9E\u90FD\u662F\u4E2D\u4E0B\u5C42\u9547\u6C11\u7684\u53CD\u53DB</strong>\uFF0C\u4ED6\u4EEC\u4E00\u6CA1\u6709\u7EC4\u7EC7\u7EAA\u5F8B\u6027\uFF0C\u4E8C\u7F3A\u4E4F\u6709\u519B\u4E8B\u7D20\u517B\u7684\u5C06\u9886\u6307\u6325\uFF0C\u4E09\u6765\u5F7C\u6B64\u4E4B\u95F4\u8FD8\u7F3A\u4E4F\u8054\u7EDC\uFF0C\u56E0\u6B64\u5F88\u5BB9\u6613\u5C31\u88AB\u5317\u9B4F\u5927\u519B\u9010\u4E00\u653B\u7834\u3002</p><p>\u6574\u4E2A\u5E73\u53DB\u8FC7\u7A0B\uFF0C\u76F8\u5BF9\u6BD4\u8F83\u7B80\u5355\u3002\u53DB\u4E71\u53EA\u6301\u7EED\u4E86\u4E00\u5E74\u591A\u4FBF\u88AB\u653B\u706D\u3002</p><p>\u63A5\u4E0B\u6765\u771F\u6B63\u5F15\u53D1\u4E86\u707E\u96BE\u7684\uFF0C\u662F\u5317\u9B4F\u653F\u5E9C\u7684\u540E\u7EED\u5904\u7406\u3002</p><p>\u516D\u9547\u4E4B\u4E71\u88AB\u5E73\u5B9A\u540E\uFF0C<strong>\u7275\u6D89\u5230\u7684\u9547\u6C11\u6709\u4E8C\u5341\u4E07\u4E4B\u591A</strong>\uFF0C\u8FD9\u4E9B\u4EBA\u8BE5\u5982\u4F55\u5B89\u7F6E\u624D\u597D\uFF1F</p><p>\u6CB3\u95F4\u738B<strong>\u5143\u6DF1</strong>\u5728\u524D\u7EBF\u5E73\u53DB\uFF0C\u4ED6\u7684\u610F\u89C1\u662F\u201C<strong>\u6539\u9547\u4E3A\u5DDE</strong>\u201D\uFF0C\u628A\u8FB9\u9547\u6539\u4E3A\u5DDE\u53BF\uFF0C\u53D6\u6D88\u519B\u6237\uFF0C\u5206\u7ED9\u9547\u6C11\u571F\u5730\uFF0C\u5C31\u5730\u5B89\u7F6E\u3002</p><p>\u4E8B\u540E\u6765\u770B\uFF0C\u8FD9\u5E94\u8BE5\u662F\u89E3\u51B3\u5317\u9547\u95EE\u9898\u6700\u7B80\u5355\u4E5F\u6700\u7A33\u59A5\u7684\u529E\u6CD5\u3002\u56E0\u4E3A\u5927\u90E8\u5206\u7684\u53CD\u53DB\u8005\u5E76\u4E0D\u662F\u5BF9\u5317\u9B4F\u7684\u7EDF\u6CBB\u6709\u5F02\u5FC3\uFF0C\u800C\u53EA\u662F\u56E0\u4E3A\u5265\u524A\u4E25\u91CD\uFF0C\u751F\u6D3B\u8D2B\u56F0\uFF0C\u624D\u6124\u7136\u53CD\u6297\u7684\u3002\u5728\u53DB\u4E71\u88AB\u9547\u538B\u4EE5\u540E\uFF0C\u89E3\u51B3\u8FD9\u4E9B\u5317\u9547\u8D2B\u6C11\u7684\u751F\u8BA1\u95EE\u9898\uFF0C\u65E0\u7591\u662F\u91DC\u5E95\u62BD\u85AA\u4E4B\u8BA1\uFF0C\u80FD\u5F7B\u5E95\u65AD\u7EDD\u540E\u987E\u4E4B\u5FE7\u3002</p><p>\u4F46\u671D\u5EF7\u5374\u6CA1\u6709\u6279\u51C6\u8FD9\u4E00\u8BBE\u60F3\uFF0C<strong>\u53CD\u800C\u662F\u5C06\u4FD8\u864F\u768420\u4E07\u9547\u6C11\u5B89\u7F6E\u5230\u4E86\u6CB3\u5317\u7684\u701B\u3001\u5180\u3001\u5B9A\u4E09\u5DDE\u5C31\u98DF</strong>\u3002</p><p>\u5143\u6DF1\u5728\u770B\u5230\u8FD9\u4EFD\u8BCF\u4EE4\u540E\u559F\u7136\u957F\u53F9\uFF1A\u201C <strong>\u6B64\u8F88\u590D\u4E3A\u4E5E\u6D3B\u77E3</strong>\uFF01\u201D</p><p>\u8FD9\u4E2A\u903B\u8F91\u518D\u7B80\u5355\u4E0D\u8FC7\uFF1A\u4E09\u5DDE\u4E4B\u5730\u65E9\u5DF2\u4EBA\u6EE1\u4E3A\u60A3\uFF0C\u5982\u4ECA\u518D\u628A\u5317\u9547\u8D2B\u6C11\u5B89\u7F6E\u5176\u4E2D\uFF0C\u52BF\u5FC5\u4F1A\u6FC0\u5316\u77DB\u76FE\u3002\u8FD9\u4E9B\u9547\u6C11\u65E2\u6709\u540C\u4E61\u4E4B\u8C0A\uFF0C\u53C8\u66FE\u7ECF\u7ED3\u6210\u8FC7\u519B\u4E8B\u7EC4\u7EC7\uFF0C\u4EE5\u540E\u82E5\u8981\u518D\u884C\u53CD\u53DB\u4E4B\u4E8B\uFF0C\u4E0D\u4F1A\u6709\u4EFB\u4F55\u7684\u6280\u672F\u56F0\u96BE\u548C\u5FC3\u7406\u8D1F\u62C5\u3002</p><p>\u4F46\u5143\u6DF1\u5728\u8FD9\u4EF6\u4E8B\u4E0A\u5E76\u6CA1\u6709\u575A\u6301\u5DF1\u89C1\u7684\u53CD\u5BF9\u671D\u5EF7\uFF0C\u56E0\u4E3A\u4ED6\u4E5F\u6709\u81EA\u5DF1\u7684\u987E\u8651\uFF1A\u671D\u5EF7\u4E4B\u6240\u4EE5\u4F1A\u505A\u8FD9\u4E2A\u51B3\u5B9A\uFF0C\u662F\u80E1\u592A\u540E\u542C\u4ECE\u4E86\u57CE\u9633\u738B<strong>\u5143\u5FBD</strong>\u7684\u610F\u89C1\u6240\u81F4\u3002<strong>\u800C\u5143\u6DF1\u4E0E\u5143\u5FBD\u4E92\u4E3A\u653F\u654C</strong>\uFF0C\u6B64\u65F6\uFF0C\u5143\u5FBD\u6B63\u5728\u6563\u5E03\u6D41\u8A00\uFF0C\u8BF4\u5143\u6DF1\u60F3\u8981\u79EF\u6512\u4E2A\u4EBA\u52BF\u529B\u3002\u56E0\u6B64\uFF0C\u5143\u6DF1\u53EA\u80FD\u5664\u58F0\u3002</p><p>\u66F4\u7CDF\u7684\u662F\uFF0C\u9547\u6C11\u5728\u8FC1\u5165\u6CB3\u5317\u540E\uFF0C\u6070\u9022\u6CB3\u5317\u5927\u65F1\u3002\u56E0\u4E3A\u751F\u5B58\u77DB\u76FE\u6108\u53D1\u5C16\u9510\uFF0C\u4EC5\u4EC5\u5728\u51E0\u4E2A\u6708\u4EE5\u540E\uFF0C<strong>\u5317\u9547\u9547\u6C11\u4FBF\u88F9\u631F\u6CB3\u5317\u96BE\u6C11\uFF0C\u7206\u53D1\u4E86\u66F4\u5927\u89C4\u6A21\u7684\u6C11\u53D8\uFF0C\u845B\u8363\u4E4B\u4E71</strong>\u2014\u2014\u6B64\u4E71\u6700\u7EC8\u7531<strong>\u5C14\u6731\u8363</strong>\u5E73\u5B9A\u3002</p><p>\u5386\u6765\u6709\u4E00\u79CD\u58F0\u97F3\uFF0C\u8BA4\u4E3A\u516D\u9547\u8D77\u4E49\u662F\u5BFC\u81F4\u5317\u9B4F\u706D\u4EA1\u7684\u7F6A\u9B41\u7978\u9996\uFF0C\u5E76\u56E0\u6B64\u800C\u5BF9\u5B5D\u6587\u5E1D\u7684\u6C49\u5316\u6539\u9769\u6301\u5426\u5B9A\u610F\u89C1\u3002</p><p>\u4F46\u901A\u8FC7\u4ECA\u5929\u7684\u56DE\u6EAF\uFF0C\u4F60\u4F1A\u53D1\u73B0\uFF0C<strong>\u5317\u9547\u4E4B\u4E71\u53EA\u662F\u8087\u56E0\uFF0C\u4E0D\u662F\u539F\u56E0</strong>\u3002</p><p>\u201C\u8087\u56E0\u201D\u548C\u201C\u539F\u56E0\u201D\u7684\u5DEE\u522B\u5728\u4E8E\uFF0C\u5B83\u5230\u5E95\u662F\u5BFC\u706B\u7D22\uFF0C\u8FD8\u662F\u706B\u836F\u6876\uFF1F</p><p><strong>\u516D\u9547\u4E4B\u4E71\u5176\u5B9E\u662F\u5BFC\u706B\u7D22</strong>\u3002</p><p>\u516D\u9547\u4E4B\u4E71\u672C\u8EAB\u5E76\u6CA1\u6709\u5F15\u53D1\u5317\u9B4F\u7684\u706D\u4EA1\uFF0C\u771F\u6B63\u5BFC\u81F4\u4E86\u5317\u9B4F\u672B\u5E74\u653F\u5C40\u5927\u4E71\u7684\uFF0C\u5176\u5B9E\u662F<strong>\u845B\u8363</strong>\u5728\u6CB3\u5317\u7684\u53DB\u4E71\uFF0C\u662F\u8FD9\u573A\u53DB\u4E71\u5F15\u51FA\u4E86\u5C14\u6731\u8363\uFF0C\u6FC0\u5316\u4E86\u5B5D\u660E\u5E1D\u4E0E\u80E1\u592A\u540E\u4E4B\u95F4\u7684\u77DB\u76FE\uFF0C\u624D\u8BA9\u5317\u9B4F\u5371\u82E5\u7D2F\u5375\u7684\u5C40\u9762\u5F7B\u5E95\u5D29\u6E83\u3002</p><p>\u5B83\u53EA\u662F\u8087\u56E0\uFF0C\u4E0D\u662F\u539F\u56E0\u3002</p><p>\u8FD9\u5C31\u597D\u6BD4\u6211\u4EEC\u7ECF\u5E38\u4E3E\u7684\u4E00\u4E2A\u4F8B\u5B50\uFF1A\u4E00\u573A\u611F\u5192\u7684\u540E\u679C\u6709\u591A\u4E25\u91CD\uFF0C\u8981\u53D6\u51B3\u4E8E\u60A3\u8005\u81EA\u5DF1\u7684\u8EAB\u4F53\u7D20\u8D28\u3002</p><p>\u5982\u679C\u60A3\u8005\u5E74\u8F7B\u529B\u58EE\uFF0C\u90A3\u53EF\u80FD\u611F\u5192\u4E5F\u5C31\u610F\u5473\u7740\u4E00\u4E2A\u661F\u671F\u7684\u54B3\u55FD\u6D41\u6D95\uFF0C\u8FC7\u4E86\u5C31\u597D\u4E86\uFF1B\u4F46\u5982\u679C\u67D3\u75C5\u7684\u662F\u5E38\u5E74\u5367\u5E8A\u7684\u8001\u5E74\u4EBA\uFF0C\u90A3\u79CB\u51AC\u5B63\u7684\u4E00\u573A\u611F\u5192\u5C31\u80FD\u8981\u4E86\u4ED6\u4EEC\u7684\u547D\u3002</p><p>\u5728\u5B5D\u6587\u5E1D\u4E4B\u540E\uFF0C\u5BA3\u6B66\u5E1D\u3001\u80E1\u592A\u540E\u4E24\u4EFB\u6267\u653F\u5DF2\u7ECF\u8BA9\u6574\u4E2A\u5317\u9B4F\u8FDB\u5165\u5230\u81EA\u7531\u843D\u4F53\u5F0F\u7684\u8870\u8D25\u4E4B\u4E2D\u3002\u8FD9\u4E2A\u8FC7\u7A0B\uFF0C\u5176\u5B9E\u5C31\u662F\u4E00\u4E2A\u5F3A\u58EE\u7684\u673A\u4F53\u56E0\u4E3A\u751F\u6D3B\u4E60\u60EF\u7B49\u5404\u65B9\u9762\u7684\u539F\u56E0\u800C\u8FC5\u901F\u8001\u5316\u7684\u8FC7\u7A0B\u3002</p><p>\u5982\u679C\u975E\u8981\u628A\u5317\u9B4F\u7684\u706D\u4EA1\u5F52\u7F6A\u4E8E\u5B5D\u6587\u5E1D\uFF0C\u90A3\u4E48\u5E94\u8BE5\u8FD9\u4E48\u8BF4\uFF1A\u4ED6\u6CA1\u6709\u8003\u8651\u5230\u516D\u9547\u95EE\u9898\uFF0C\u8FD9\u786E\u5B9E\u662F\u539F\u7F6A\u4E4B\u4E00\u3002\u4F46\u662F\uFF0C\u8FD8\u662F\u90A3\u53E5\u8BDD\uFF0C\u516D\u9547\u53EA\u662F\u5BFC\u706B\u7D22\uFF0C\u4E0D\u662F\u706B\u836F\u6876\u3002</p><p>\u5B5D\u6587\u5E1D\u82E5\u6CC9\u4E0B\u6709\u77E5\uFF0C\u5927\u6982\u4E5F\u4E0D\u4F1A\u60F3\u5230\u4EC5\u4EC5\u5728\u4ED6\u8EAB\u540E\u4E09\u5341\u5E74\uFF0C\u4E00\u4E2A\u84EC\u52C3\u5411\u4E0A\u7684\u5E1D\u56FD\u5C31\u4F1A\u5FFD\u7136\u95F4\u5931\u53BB\u751F\u673A\u4E0E\u6D3B\u529B\uFF1B\u4E00\u573A\u5185\u90E8\u53DB\u4E71\uFF0C\u5C31\u80FD\u5F15\u53D1\u5168\u5C40\u6027\u7684\u6E83\u8D25\u3002</p><p>\u800C\u5982\u679C\u62BD\u79BB\u4E86\u5317\u9B4F\u7684\u5177\u4F53\u73AF\u5883\u548C\u5C40\u9762\uFF0C\u4ECE\u66F4\u4E3A\u62BD\u8C61\u7684\u610F\u4E49\u4E0A\u6765\u89E3\u8BFB\u8FD9\u6BB5\u5386\u53F2\uFF0C\u90A3\u4E48\uFF0C<strong>\u5317\u65B9\u516D\u9547\u5728\u53D1\u751F\u53DB\u4E71\u524D\u7684\u60C5\u5F62\uFF0C\u5C31\u662F\u4E00\u4E2A\u7EC4\u7EC7\u5728\u6CA1\u843D\u8FC7\u7A0B\u4E2D\u7684\u5178\u578B\u8868\u73B0</strong>\u3002</p><p>\u8FD9\u4E2A\u7EC4\u7EC7\u7684\u6700\u5927\u7279\u70B9\uFF0C<strong>\u662F\u81EA\u8EAB\u6CA1\u6709\u529E\u6CD5\u4EA7\u751F\u5229\u76CA\uFF0C\u6240\u6709\u7EF4\u7CFB\u5B83\u5B58\u5728\u7684\u8D44\u6E90\u90FD\u8981\u4ECE\u5916\u754C\u83B7\u53D6</strong>\u3002</p><p>\u8FD9\u4E5F\u662F\u5B83\u7684\u8F6F\u808B\u6240\u5728\uFF0C\u4E00\u65E6\u5931\u53BB\u4E86\u5916\u754C\u6765\u6E90\uFF0C\u53C8\u6CA1\u6709\u529E\u6CD5\u4ECE\u5185\u90E8\u4EA7\u751F\u8D44\u6E90\u4EE5\u5F25\u8865\u7F3A\u5931\u7684\u90E8\u5206\uFF0C\u5C31\u53EA\u80FD\u662F\u901A\u8FC7<strong>\u5185\u90E8\u7ADE\u4E89</strong>\u6765\u91CD\u65B0\u5206\u914D\u8D44\u6E90\u3002</p><p>\u800C\u56E0\u4E3A\u6709\u519B\u4E8B\u7EC4\u7EC7\u8FD9\u79CD\u81EA\u4E0A\u800C\u4E0B\u7684\u6743\u529B\u7ED3\u6784\u5B58\u5728\uFF0C\u6240\u4EE5\u8FD9\u79CD\u7ADE\u4E89\u53C8\u4E0D\u4F1A\u50CF\u81EA\u7531\u7ADE\u4E89\u5E02\u573A\u4E00\u6837\u8FBE\u5230\u201C\u6548\u7387\u6700\u4F18\u201D\uFF0C<strong>\u800C\u53EA\u4F1A\u662F\u8D44\u6E90\u66F4\u52A0\u5411\u5C11\u90E8\u5206\u4EBA\u96C6\u4E2D\uFF1A\u8C01\u80FD\u638C\u63E1\u4E86\u6743\u529B\uFF0C\u8C01\u5C31\u80FD\u638C\u63E1\u8D44\u6E90</strong>\u3002</p><p>\u4E0D\u662F\u201C\u5929\u4E4B\u9053\u635F\u6709\u4F59\u800C\u8865\u4E0D\u8DB3\u201D\uFF0C\u800C\u662F\u201C\u9A6C\u592A\u6548\u5E94\u201D\uFF1A\u5BCC\u8005\u6108\u5BCC\uFF0C\u8D2B\u8005\u6108\u8D2B\u2014\u2014\u4F60\u5982\u679C\u7406\u89E3\u4E0D\u4E86\uFF0C\u90A3\u53EF\u4EE5\u53C2\u7167\u4E00\u4E0B\u4E1C\u5317\u65B9\u7684\u90BB\u56FD\u3002</p><p>\u5728\u6B63\u5E38\u7684\u7EC4\u7EC7\u4E2D\uFF0C\u5982\u679C\u5DF2\u7ECF\u4EA7\u751F\u4E86\u8FD9\u79CD\u6076\u6027\u5FAA\u73AF\u7684\u5148\u5146\uFF0C\u90A3\u4E48\u7EC4\u7EC7\u5185\u7684\u51B3\u7B56\u5C42\u4E00\u5B9A\u4F1A\u6709\u6240\u5BDF\u89C9\uFF0C\u5E76\u5C3D\u529B\u4E88\u4EE5\u7EA0\u6B63\uFF0C\u7F13\u548C\u77DB\u76FE\u3002<strong>\u4F46\u5728\u5317\u9547\uFF0C\u8FD9\u4E00\u70B9\u4F9D\u7136\u4E0D\u5B58\u5728</strong>\uFF1A\u4E0D\u7BA1\u662F\u51FA\u8EAB\u4E8E\u9C9C\u5351\u8D35\u65CF\u7684\u519B\u5B98\uFF0C\u8FD8\u662F\u6D41\u653E\u5230\u5317\u9547\u7684\u56DA\u72AF\uFF0C\u4ED6\u4EEC\u7684\u77E5\u8BC6\u6587\u5316\u6C34\u5E73\u90FD\u5341\u5206\u6709\u9650\uFF0C\u4E0D\u89C1\u5F97\u6709\u9884\u77E5\u672A\u6765\u7684\u80FD\u529B\u3002</p><p>\u66F4\u4F55\u51B5\uFF0C\u5317\u9547\u519B\u5B98\u7684\u5FC3\u91CC\u5F88\u53EF\u80FD\u8FD8\u62B1\u7740\u4E00\u4E1D\u4FA5\u5E78\uFF1A\u60DF\u5176\u5982\u6B64\uFF0C\u53EA\u6709\u641E\u51FA\u4E00\u4E9B\u52A8\u9759\u6765\uFF0C\u624D\u80FD\u8BA9\u671D\u5EF7\u7684\u886E\u886E\u8BF8\u516C\u770B\u5230\u6211\u4EEC\u5317\u9547\u7684\u5B58\u5728\uFF01\u5426\u5219\uFF0C\u5317\u9547\u5730\u533A\u7684\u5B58\u5728\u611F\u5C31\u53EA\u4F1A\u8D8A\u6765\u8D8A\u5F31\uFF01</p><p>\u8FD9\u5C31\u662F\u6211\u4EEC\u4E00\u822C\u610F\u4E49\u4E0A\u7406\u89E3\u7684\u201C<strong>\u5185\u5377</strong>\u201D\uFF1A<strong>\u5F53\u4E00\u4E2A\u7EC4\u7EC7\u5185\u7684\u8D44\u6E90\u6EE1\u8DB3\u4E0D\u4E86\u5176\u6210\u5458\u7684\u9700\u6C42\u65F6\uFF0C\u5F7C\u6B64\u4E4B\u95F4\u7684\u7ADE\u4E89\u4FBF\u4F1A\u8D8A\u6765\u8D8A\u6FC0\u70C8\uFF1B\u540C\u65F6\uFF0C\u4F34\u968F\u7684\u662F\u6210\u5458\u4E2A\u4F53\u7684\u6536\u76CA\u65E5\u6E10\u4E0B\u964D\u7684\u8D8B\u52BF</strong>\u3002</p><p>\u516D\u9547\u5982\u662F\u3002</p><p>\u800C\u6211\u4EEC\u5982\u679C\u4ECE\u66F4\u5927\u7684\u89C6\u89D2\u6765\u7406\u89E3\uFF0C\u90A3\u4E48\u53EF\u4EE5\u8FD9\u4E48\u8BA4\u4E3A\uFF0C<strong>\u5317\u9547\u7684\u7ECF\u5386\uFF0C\u5176\u5B9E\u662F\u4F20\u7EDF\u519C\u4E1A\u793E\u4F1A\u5FC5\u7136\u4F1A\u8D70\u5411\u5185\u5377\u5316\u7684\u7F29\u5F71</strong>\u3002</p><p>\u56E0\u4E3A\u571F\u5730\u6240\u80FD\u5438\u7EB3\u7684\u4EBA\u53E3\u6709\u9650\uFF0C\u800C\u4E14\u571F\u5730\u4E5F\u6709\u4E0A\u9650\uFF0C\u6240\u4EE5\uFF0C\u968F\u7740\u548C\u5E73\u5E74\u4EE3\u7684\u65F6\u95F4\u8D8A\u6765\u8D8A\u957F\uFF0C\u5355\u4F4D\u9762\u79EF\u5185\u6240\u5438\u7EB3\u7684\u52B3\u52A8\u4EBA\u53E3\u4E5F\u5C31\u8D8A\u6765\u8D8A\u591A\u3002\u8FD9\u79CD\u65F6\u5019\uFF0C\u201C<strong>\u9A6C\u5C14\u8428\u65AF\u9677\u9631</strong>\u201D\u4FBF\u4F1A\u51FA\u73B0\uFF0C\u8FD9\u5C31\u662F\u6240\u8C13\u7684\u5185\u5377\u3002</p><p>\u8FD9\u4E2A\u903B\u8F91\u518D\u5F80\u4E0A\u63A8\u4E00\u5C42\u7684\u8BDD\uFF0C\u5219\u662F<strong>\u6E38\u7267\u6C11\u65CF\u7684\u5185\u5377</strong>\u3002</p><p>\u4E3A\u4EC0\u4E48\u5728\u4E2D\u56FD\u7684\u5386\u53F2\u4E0A\uFF0C\u5317\u65B9\u7684\u6E38\u7267\u6C11\u65CF\u53CD\u590D\u5357\u4E0B\u9A9A\u6270\u6C49\u5730\uFF1F\u4E5F\u662F\u56E0\u4E3A\u8D44\u6E90\u532E\u4E4F\u3002<strong>\u6E38\u7267\u6C11\u65CF\u5BF9\u4E8E\u81EA\u7136\u73AF\u5883\u53D8\u5316\u7684\u62B5\u6297\u80FD\u529B\uFF0C\u6BD4\u4E4B\u519C\u8015\u6C11\u65CF\u66F4\u5F31</strong>\uFF0C\u4E00\u573A\u5927\u65F1\u5C31\u53EF\u80FD\u8BA9\u6574\u4E2A\u6C11\u65CF\u9677\u5165\u706D\u7EDD\u7684\u8FB9\u7F18\u3002\u56E0\u6B64\uFF0C\u4E00\u65E6\u81EA\u6709\u4EA7\u51FA\u6CA1\u6709\u529E\u6CD5\u6EE1\u8DB3\u751F\u5B58\u9700\u6C42\uFF0C\u5357\u4E0B\u62A2\u63A0\u5C31\u4F1A\u53D8\u6210\u552F\u4E00\u51FA\u8DEF\u3002</p><p>\u5177\u4F53\u5230\u5317\u9B4F\u65F6\u671F\u5317\u65B9\u516D\u9547\u7684\u5185\u5377\uFF0C\u5219\u53EF\u770B\u4F5C\u662F\u6709\u4EBA\u4EBA\u4E3A\u7684\u5212\u5B9A\u4E86\u4E00\u4E2A\u533A\u57DF\uFF0C\u7136\u540E\u53C8\u9650\u5236\u4F4F\u8D44\u6E90\u7684\u8FDB\u5165\u4E0E\u6210\u5458\u7684\u9000\u51FA\uFF0C\u5982\u6B64\uFF0C\u624D\u5BFC\u81F4\u4E86\u5185\u5377\u7684\u53D1\u751F\u3002</p>',79),g=[s];function e(c,a){return o(),t("div",null,g)}const _=p(r,[["render",e],["__file","mutinyAndInvolution.html.vue"]]);export{_ as default};
